('sw', '_template', 'chat_help_display_blurb', '<p>Kumb: <em>Kwenda kwenye</em> links na kwenye <em> Key za haraka </em>\r\nlisti itajitokeza tu mara utakapo weka on  <em> Navigation Aids </em> kwenye mapendekazo yako.</p> \r\n<ul>\r\n	<li>Ya <em> kwenda kwenye Keys za haraka </em> Link  hapo juu itakupeleka kwenye\r\n    keys za haraka za Kuongelea\r\n      </li>\r\n\r\n	<li>Ya <em>Area ya Manongezi </em> huonyesha maongezi mapya hadi kumi (10)\r\n     </li>\r\n\r\n    <li>Ya <em>Nenda kwenye Maongezi</em>Link itakupeleka mwanzoni mwa mlolongo wa Maongezi\r\n   \r\n(Alt+M+Enter) </li>\r\n\r\n    <li>Ya <em>Refresh Moangezi </em> link Itakuruhusu kuangalia Maongezi Mapya\r\n     (Alt+R+Enter). </li>\r\n\r\n    <li>Ya<em>Andika Maongezi </em> Field na <em> Tuma Button</em> Itakuruhusu kujaza na kutuma Maongezi\r\n    \r\n(Alt+C  Ili kuingia kwenye field ya kundikia, jaza ili kutuma Maongezi yaliyokamilishwa). </li>\r\n\r\n</ul>', '2004-09-14 14:25:22', ''),
